// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract TimeCapsuleVault {
    address public creator;
    uint256 public unlockTime;
    uint256 public targetPrice;
    uint256 public targetAmount;
    uint256 public immutable createdAt; // Contract creation timestamp for emergency withdrawal
    AggregatorV3Interface public priceFeed;
    bool public isPriceLock;
    bool public isGoalLock;

    // Reentrancy protection
    bool private locked;

    // Constants for validation
    uint256 public constant MAX_LOCK_DURATION = 10 * 365 days; // 10 years max
    uint256 public constant MIN_LOCK_DURATION = 1 hours; // 1 hour min
    uint256 public constant MAX_TARGET_AMOUNT = 10000 ether; // 10,000 ETH max
    uint256 public constant PRICE_DECIMALS = 8; // Chainlink price decimals
    uint256 public constant MAX_PRICE_CHANGE = 50; // 50% max price change per hour (circuit breaker)

    // For oracle circuit breaker
    int256 private lastValidPrice;
    uint256 private lastPriceUpdate;

    event PriceUpdated(int256 newPrice);
    event VaultUnlocked(string reason);
    event GoalProgress(uint256 currentAmount, uint256 targetAmount, uint256 progressPercentage);
    event Deposit(address indexed depositor, uint256 amount);
    event Withdrawal(address indexed creator, uint256 amount);
    // Event for automatic withdrawals
    event AutoWithdrawal(address indexed creator, uint256 amount, string reason);

    modifier noReentrant() {
        require(!locked, "ReentrancyGuard: reentrant call");
        locked = true;
        _;
        locked = false;
    }

    modifier onlyCreator() {
        require(msg.sender == creator, "Not authorized");
        _;
    }

    modifier autoWithdrawIfUnlocked() {
        _;
        // After any state change, check if vault should auto-withdraw
        _checkAndExecuteAutoWithdraw();
    }

    constructor(
        uint256 _unlockTime, 
        address _owner, 
        uint256 _targetPrice, 
        uint256 _targetAmount, 
        address _priceFeedAddress
    ) {
        // Input validation
        require(_owner != address(0), "Invalid owner address");
        require(_priceFeedAddress != address(0), "Invalid price feed address");

        // Time validation
        if (_unlockTime > 0) {
            require(_unlockTime > block.timestamp, "Unlock time must be in future");
            require(_unlockTime <= block.timestamp + MAX_LOCK_DURATION, "Lock duration too long");
            require(_unlockTime >= block.timestamp + MIN_LOCK_DURATION, "Lock duration too short");
        }

        // Amount validation
        if (_targetAmount > 0) {
            require(_targetAmount <= MAX_TARGET_AMOUNT, "Target amount too high");
            require(_targetAmount >= 0.001 ether, "Target amount too low");
        }

        // Price validation (basic check - price should be positive)
        if (_targetPrice > 0) {
            require(_targetPrice > 0, "Target price must be positive");
        }

        creator = _owner;
        unlockTime = _unlockTime;
        targetPrice = _targetPrice;
        targetAmount = _targetAmount;
        priceFeed = AggregatorV3Interface(_priceFeedAddress);
        isPriceLock = _targetPrice > 0;
        isGoalLock = _targetAmount > 0;

        // At least one lock condition must be set
        require(_unlockTime > 0 || _targetPrice > 0 || _targetAmount > 0, "At least one lock condition required");

        // Set contract creation timestamp for emergency withdrawal
        createdAt = block.timestamp;
    }

    function deposit() external payable autoWithdrawIfUnlocked {
        require(msg.value >= 0.001 ether, "Minimum deposit is 0.001 ETH");
        require(address(this).balance <= MAX_TARGET_AMOUNT, "Vault would exceed maximum capacity");

        if (isGoalLock) {
            uint256 currentBalance = address(this).balance;
            uint256 progressPercentage = (currentBalance * 100) / targetAmount;
            emit GoalProgress(currentBalance, targetAmount, progressPercentage);
        }

        emit Deposit(msg.sender, msg.value);
    }

    function getLatestPrice() public view returns (int256) {
        try priceFeed.latestRoundData() returns (
            uint80 roundId,
            int256 price,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        ) {
            require(price > 0, "Invalid price from oracle");
            require(updatedAt > 0, "Round not complete");
            require(block.timestamp - updatedAt < 1 hours, "Price data too old");

            // Circuit breaker: check for extreme price changes
            if (lastValidPrice > 0 && lastPriceUpdate > 0) {
                uint256 timeDiff = block.timestamp - lastPriceUpdate;
                if (timeDiff < 1 hours) {
                    // Calculate percentage change
                    uint256 priceChange = price > lastValidPrice ? 
                        uint256((price - lastValidPrice) * 100 / lastValidPrice) :
                        uint256((lastValidPrice - price) * 100 / lastValidPrice);

                    require(priceChange <= MAX_PRICE_CHANGE, "Price change too extreme");
                }
            }

        return price;
        } catch {
            revert("Failed to get price from oracle");
        }
    }

    // Internal function to update last valid price (for circuit breaker)
    function _updateLastValidPrice() internal {
        try this.getLatestPrice() returns (int256 price) {
            lastValidPrice = price;
            lastPriceUpdate = block.timestamp;
            emit PriceUpdated(price);
        } catch {
            // Price update failed, keep using last valid price
        }
    }

    function withdraw() external onlyCreator noReentrant {
        require(address(this).balance > 0, "Nothing to withdraw");

        bool canUnlock = false;
        string memory unlockReason = "";

        // Check time lock
        if (unlockTime > 0 && block.timestamp >= unlockTime) {
            canUnlock = true;
            unlockReason = "Time lock expired";
        }

        // Check price lock
        if (isPriceLock && !canUnlock) {
            try this.getLatestPrice() returns (int256 currentPrice) {
                if (uint256(currentPrice) >= targetPrice) {
            canUnlock = true;
            unlockReason = "Price target reached";
                }
            } catch {
                // If price feed fails, don't allow price-based unlock
                // User can still unlock via time or goal conditions
            }
        }

        // Check goal lock
        if (isGoalLock && !canUnlock) {
            if (address(this).balance >= targetAmount) {
            canUnlock = true;
            unlockReason = "Goal amount reached";
            }
        }

        require(canUnlock, "Vault is still locked");

        uint256 amount = address(this).balance;

        // Use call instead of transfer for better gas compatibility
        (bool success, ) = payable(creator).call{value: amount}("");
        require(success, "Transfer failed");

        emit VaultUnlocked(unlockReason);
        emit Withdrawal(creator, amount);
    }

    function getLockStatus() external view returns (
        bool isLocked,
        uint256 currentPrice,
        uint256 timeRemaining,
        bool isPriceBased,
        bool isGoalBased,
        uint256 currentAmount,
        uint256 goalAmount,
        uint256 progressPercentage,
        string memory unlockReason
    ) {
        // Get current price safely
        try this.getLatestPrice() returns (int256 price) {
            currentPrice = uint256(price);
        } catch {
            currentPrice = 0; // Indicate price feed failure
        }

        timeRemaining = block.timestamp >= unlockTime ? 0 : unlockTime - block.timestamp;
        isPriceBased = isPriceLock;
        isGoalBased = isGoalLock;
        currentAmount = address(this).balance;
        goalAmount = targetAmount;
        progressPercentage = isGoalLock && targetAmount > 0 ? (currentAmount * 100) / targetAmount : 0;

        // Determine lock status
        bool timeUnlocked = (unlockTime > 0) ? (block.timestamp >= unlockTime) : false;
        bool priceUnlocked = (isPriceLock && currentPrice > 0) ? (currentPrice >= targetPrice) : false;
        bool goalUnlocked = isGoalLock ? (currentAmount >= targetAmount) : false;

        if (timeUnlocked) {
            isLocked = false;
            unlockReason = "Time lock expired";
        } else if (priceUnlocked) {
            isLocked = false;
            unlockReason = "Price target reached";
        } else if (goalUnlocked) {
            isLocked = false;
            unlockReason = "Goal amount reached";
        } else {
            isLocked = true;
            if (isGoalLock) {
                unlockReason = "Waiting for goal amount";
            } else if (isPriceLock) {
                unlockReason = "Waiting for price target";
            } else {
                unlockReason = "Waiting for time lock";
            }
        }
    }

    // Emergency function - allows creator to withdraw after a very long time regardless of conditions
    // This prevents funds from being permanently locked due to oracle failures
    function emergencyWithdraw() external onlyCreator noReentrant {
        // Emergency withdrawal available after 1 year from contract creation or unlock time (whichever is later)
        uint256 emergencyTime = unlockTime > 0 ? unlockTime + 365 days : createdAt + 365 days;
        require(block.timestamp >= emergencyTime, "Emergency withdraw not available yet");
        require(address(this).balance > 0, "Nothing to withdraw");

        uint256 amount = address(this).balance;
        (bool success, ) = payable(creator).call{value: amount}("");
        require(success, "Emergency transfer failed");

        emit VaultUnlocked("Emergency withdrawal");
        emit Withdrawal(creator, amount);
    }

    // View function to check if emergency withdrawal is available
    function canEmergencyWithdraw() external view returns (bool) {
        uint256 emergencyTime = unlockTime > 0 ? unlockTime + 365 days : createdAt + 365 days;
        return block.timestamp >= emergencyTime && address(this).balance > 0;
    }

    // Internal function to check and execute automatic withdrawal
    function _checkAndExecuteAutoWithdraw() internal noReentrant {
        if (address(this).balance == 0) return; // Nothing to withdraw

        bool canUnlock = false;
        string memory unlockReason = "";

        // Check time lock
        if (unlockTime > 0 && block.timestamp >= unlockTime) {
            canUnlock = true;
            unlockReason = "Time lock expired";
        }

        // Check price lock
        if (isPriceLock && !canUnlock) {
            try this.getLatestPrice() returns (int256 currentPrice) {
                if (uint256(currentPrice) >= targetPrice) {
                    canUnlock = true;
                    unlockReason = "Price target reached";
                }
            } catch {
                // If price feed fails, don't auto-withdraw
                return;
            }
        }

        // Check goal lock
        if (isGoalLock && !canUnlock) {
            if (address(this).balance >= targetAmount) {
                canUnlock = true;
                unlockReason = "Goal amount reached";
            }
        }

        // If unlocked, automatically withdraw to creator
        if (canUnlock) {
            uint256 amount = address(this).balance;

            // Use call instead of transfer for better gas compatibility
            (bool success, ) = payable(creator).call{value: amount}("");
            if (success) {
                emit AutoWithdrawal(creator, amount, unlockReason);
                emit VaultUnlocked(unlockReason);
                emit Withdrawal(creator, amount);
            }
            // If transfer fails, vault remains locked for manual withdrawal
        }
    }

    // Public function that anyone can call to trigger auto-withdrawal check
    // This allows external services, bots, or users to trigger withdrawals
    function triggerAutoWithdraw() external {
        _checkAndExecuteAutoWithdraw();
    }

    // Function to check if vault can be auto-withdrawn (view function)
    function canAutoWithdraw() external view returns (bool canUnlock, string memory reason) {
        if (address(this).balance == 0) return (false, "No funds to withdraw");

        // Check time lock
        if (unlockTime > 0 && block.timestamp >= unlockTime) {
            return (true, "Time lock expired");
        }

        // Check price lock
        if (isPriceLock) {
            try this.getLatestPrice() returns (int256 currentPrice) {
                if (uint256(currentPrice) >= targetPrice) {
                    return (true, "Price target reached");
                }
            } catch {
                // Price feed failed, can't determine
                return (false, "Price feed unavailable");
            }
        }

        // Check goal lock
        if (isGoalLock && address(this).balance >= targetAmount) {
            return (true, "Goal amount reached");
        }

        return (false, "Vault still locked");
    }
}

contracts/VaultAutomation.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./TimeCapsuleVault.sol";

// Interface for Chainlink Automation
interface AutomationCompatibleInterface {
    function checkUpkeep(bytes calldata checkData)
        external
        view
        returns (bool upkeepNeeded, bytes memory performData);

    function performUpkeep(bytes calldata performData) external;
}

/**
 * @title VaultAutomation
 * @dev Chainlink Automation-compatible contract for automatic vault withdrawals
 * This contract makes vaults truly autonomous - they will automatically withdraw
 * when conditions are met, even if the DApp is offline
 */
contract VaultAutomation is AutomationCompatibleInterface {
    address public owner; // Contract owner
    address public factoryContract; // Authorized factory contract
    TimeCapsuleVault[] public monitoredVaults;
    mapping(address => bool) public isMonitored;
    
    // Gas limit constants to prevent DoS
    uint256 public constant MAX_VAULTS_PER_UPKEEP = 20; // Max vaults to process in one upkeep
    uint256 public constant WITHDRAWAL_GAS_LIMIT = 100000; // Gas limit per withdrawal
    
    event VaultAdded(address indexed vault);
    event VaultRemoved(address indexed vault);
    event AutoWithdrawTriggered(address indexed vault, string reason);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event FactoryContractSet(address indexed factoryContract);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized: only owner");
        _;
    }

    modifier onlyAuthorized() {
        require(msg.sender == owner || msg.sender == factoryContract, "Not authorized");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @dev Set the authorized factory contract (only owner)
     * @param _factoryContract Address of the VaultFactory contract
     */
    function setFactoryContract(address _factoryContract) external onlyOwner {
        require(_factoryContract != address(0), "Invalid factory contract");
        factoryContract = _factoryContract;
        emit FactoryContractSet(_factoryContract);
    }

    /**
     * @dev Transfer ownership (only owner)
     * @param newOwner Address of the new owner
     */
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner cannot be zero address");
        address previousOwner = owner;
        owner = newOwner;
        emit OwnershipTransferred(previousOwner, newOwner);
    }

    /**
     * @dev Add a vault to be monitored for automatic withdrawal
     * @param vault Address of the TimeCapsuleVault to monitor
     */
    function addVault(address vault) external onlyAuthorized {
        require(!isMonitored[vault], "Vault already monitored");
        
        TimeCapsuleVault vaultContract = TimeCapsuleVault(vault);
        // Verify it's a valid vault by checking if it has a creator
        require(vaultContract.creator() != address(0), "Invalid vault contract");
        
        monitoredVaults.push(vaultContract);
        isMonitored[vault] = true;
        
        emit VaultAdded(vault);
    }

    /**
     * @dev Remove a vault from monitoring (e.g., after withdrawal)
     * @param vault Address of the vault to stop monitoring
     */
    function removeVault(address vault) external onlyAuthorized {
        require(isMonitored[vault], "Vault not monitored");
        
        // Find and remove vault from array
        for (uint i = 0; i < monitoredVaults.length; i++) {
            if (address(monitoredVaults[i]) == vault) {
                monitoredVaults[i] = monitoredVaults[monitoredVaults.length - 1];
                monitoredVaults.pop();
                break;
            }
        }
        
        isMonitored[vault] = false;
        emit VaultRemoved(vault);
    }

    /**
     * @dev Chainlink Automation function - checks if any vaults need withdrawal
     * @return upkeepNeeded True if any vault can be auto-withdrawn
     * @return performData Encoded vault addresses that need withdrawal
     */
    function checkUpkeep(bytes calldata /* checkData */)
        external
        view
        override
        returns (bool upkeepNeeded, bytes memory performData)
    {
        address[] memory vaultsToWithdraw = new address[](MAX_VAULTS_PER_UPKEEP);
        uint256 count = 0;

        // Check each monitored vault (limited to prevent gas issues)
        uint256 maxToCheck = monitoredVaults.length > MAX_VAULTS_PER_UPKEEP ? MAX_VAULTS_PER_UPKEEP : monitoredVaults.length;
        
        for (uint i = 0; i < maxToCheck && count < MAX_VAULTS_PER_UPKEEP; i++) {
            TimeCapsuleVault vault = monitoredVaults[i];
            
            try vault.canAutoWithdraw() returns (bool canUnlock, string memory /* reason */) {
                if (canUnlock) {
                    vaultsToWithdraw[count] = address(vault);
                    count++;
                }
            } catch {
                // Skip vaults that can't be checked (might be invalid)
                continue;
            }
        }

        if (count > 0) {
            // Resize array to actual count
            address[] memory finalVaults = new address[](count);
            for (uint i = 0; i < count; i++) {
                finalVaults[i] = vaultsToWithdraw[i];
            }
            
            upkeepNeeded = true;
            performData = abi.encode(finalVaults);
        } else {
            upkeepNeeded = false;
            performData = "";
        }
    }

    /**
     * @dev Chainlink Automation function - executes automatic withdrawals
     * @param performData Encoded array of vault addresses to withdraw from
     */
    function performUpkeep(bytes calldata performData) external override {
        address[] memory vaultsToWithdraw = abi.decode(performData, (address[]));
        
        // Limit to prevent gas issues
        uint256 maxToProcess = vaultsToWithdraw.length > MAX_VAULTS_PER_UPKEEP ? MAX_VAULTS_PER_UPKEEP : vaultsToWithdraw.length;
        
        for (uint i = 0; i < maxToProcess; i++) {
            address vaultAddress = vaultsToWithdraw[i];
            
            if (isMonitored[vaultAddress]) {
                TimeCapsuleVault vault = TimeCapsuleVault(vaultAddress);
                
                // Use try-catch with gas limit to prevent DoS
                try vault.triggerAutoWithdraw{gas: WITHDRAWAL_GAS_LIMIT}() {
                    emit AutoWithdrawTriggered(vaultAddress, "Chainlink Automation");
                    
                    // Remove vault from monitoring after successful withdrawal if it's empty
                    if (address(vault).balance == 0) {
                        // Internal removal logic
                        for (uint j = 0; j < monitoredVaults.length; j++) {
                            if (address(monitoredVaults[j]) == vaultAddress) {
                                monitoredVaults[j] = monitoredVaults[monitoredVaults.length - 1];
                                monitoredVaults.pop();
                                break;
                            }
                        }
                        isMonitored[vaultAddress] = false;
                        emit VaultRemoved(vaultAddress);
                    }
                } catch {
                    // Withdrawal failed, keep monitoring
                    continue;
                }
            }
        }
    }

    /**
     * @dev Get all monitored vault addresses
     * @return Array of vault addresses being monitored
     */
    function getMonitoredVaults() external view returns (address[] memory) {
        address[] memory vaultAddresses = new address[](monitoredVaults.length);
        for (uint i = 0; i < monitoredVaults.length; i++) {
            vaultAddresses[i] = address(monitoredVaults[i]);
        }
        return vaultAddresses;
    }

    /**
     * @dev Get total number of monitored vaults
     */
    function getMonitoredVaultCount() external view returns (uint256) {
        return monitoredVaults.length;
    }
}

contracts/VaultFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./TimeCapsuleVault.sol";
import "./ERC20TimeCapsuleVault.sol";
import "./VaultAutomation.sol";

contract VaultFactory {
    address public owner; // Factory owner for admin functions
    mapping(address => address[]) public userVaults;
    mapping(address => bool) public validVaults; // Track valid vaults created by this factory
    mapping(address => bool) public isERC20Vault; // Track if vault is ERC-20 or native token

    uint256 public totalVaultsCreated;
    uint256 public constant MAX_VAULTS_PER_USER = 100; // Prevent spam

    VaultAutomation public automationContract; // Reference to automation contract

    event VaultCreated(address indexed user, address indexed vaultAddress, uint256 indexed vaultId, bool isERC20);
    event ERC20VaultCreated(address indexed user, address indexed vaultAddress, address indexed tokenAddress, uint256 vaultId);
    event VaultRemoved(address indexed user, address indexed vaultAddress);
    event AutomationContractSet(address indexed automationContract);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized: only owner");
        _;
    }

    constructor(address _automationContract) {
        owner = msg.sender; // Set deployer as initial owner
        if (_automationContract != address(0)) {
            automationContract = VaultAutomation(_automationContract);
            emit AutomationContractSet(_automationContract);
        }
    }

    /**
     * @dev Set or update the automation contract address (only owner)
     * @param _automationContract Address of the VaultAutomation contract
     */
    function setAutomationContract(address _automationContract) external onlyOwner {
        require(_automationContract != address(0), "Invalid automation contract");
        automationContract = VaultAutomation(_automationContract);
        emit AutomationContractSet(_automationContract);
    }

    /**
     * @dev Transfer ownership of the factory (only owner)
     * @param newOwner Address of the new owner
     */
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner cannot be zero address");
        address previousOwner = owner;
        owner = newOwner;
        emit OwnershipTransferred(previousOwner, newOwner);
    }

    modifier validVaultParams(uint256 _unlockTime, uint256 _targetPrice, uint256 _targetAmount) {
        require(
            _unlockTime > 0 || _targetPrice > 0 || _targetAmount > 0,
            "At least one lock condition required"
        );

        if (_unlockTime > 0) {
            require(_unlockTime > block.timestamp, "Unlock time must be in future");
            require(_unlockTime <= block.timestamp + (10 * 365 days), "Lock duration too long");
        }

        if (_targetAmount > 0) {
            require(_targetAmount >= 0.001 ether, "Target amount too low");
            require(_targetAmount <= 10000 ether, "Target amount too high");
        }

        if (_targetPrice > 0) {
            require(_targetPrice > 0, "Target price must be positive");
        }
        _;
    }

    modifier validERC20VaultParams(uint256 _unlockTime, uint256 _targetPrice, uint256 _targetAmount) {
        require(
            _unlockTime > 0 || _targetPrice > 0 || _targetAmount > 0,
            "At least one lock condition required"
        );

        if (_unlockTime > 0) {
            require(_unlockTime > block.timestamp, "Unlock time must be in future");
            require(_unlockTime <= block.timestamp + (10 * 365 days), "Lock duration too long");
        }

        if (_targetAmount > 0) {
            require(_targetAmount >= 1, "Target amount too low"); // At least 1 token
            require(_targetAmount <= 10000 * 10**18, "Target amount too high"); // 10,000 tokens max
        }

        if (_targetPrice > 0) {
            require(_targetPrice > 0, "Target price must be positive");
        }
        _;
    }

    function createVault(
        uint256 _unlockTime, 
        uint256 _targetPrice, 
        uint256 _targetAmount, 
        address _priceFeedAddress
    ) 
        external 
        validVaultParams(_unlockTime, _targetPrice, _targetAmount)
        returns (address) 
    {
        require(_priceFeedAddress != address(0), "Invalid price feed address");
        require(userVaults[msg.sender].length < MAX_VAULTS_PER_USER, "Too many vaults for this user");

        TimeCapsuleVault vault = new TimeCapsuleVault(
            _unlockTime, 
            msg.sender, 
            _targetPrice, 
            _targetAmount, 
            _priceFeedAddress
        );

        address vaultAddress = address(vault);
        userVaults[msg.sender].push(vaultAddress);
        validVaults[vaultAddress] = true;
        isERC20Vault[vaultAddress] = false;
        totalVaultsCreated++;

        // Automatically register vault with automation system if available
        if (address(automationContract) != address(0)) {
            try automationContract.addVault(vaultAddress) {
                // Vault successfully registered for automatic withdrawal
            } catch {
                // Automation registration failed, but vault creation succeeded
                // Users can still manually register or withdraw
            }
        }

        emit VaultCreated(msg.sender, vaultAddress, totalVaultsCreated, false);
        return vaultAddress;
    }

    function createERC20Vault(
        uint256 _unlockTime, 
        uint256 _targetPrice, 
        uint256 _targetAmount, 
        address _priceFeedAddress,
        address _tokenAddress
    ) 
        external 
        validERC20VaultParams(_unlockTime, _targetPrice, _targetAmount)
        returns (address) 
    {
        require(_priceFeedAddress != address(0), "Invalid price feed address");
        require(_tokenAddress != address(0), "Invalid token address");
        require(userVaults[msg.sender].length < MAX_VAULTS_PER_USER, "Too many vaults for this user");

        ERC20TimeCapsuleVault vault = new ERC20TimeCapsuleVault(
            _unlockTime, 
            msg.sender, 
            _targetPrice, 
            _targetAmount, 
            _priceFeedAddress,
            _tokenAddress
        );

        address vaultAddress = address(vault);
        userVaults[msg.sender].push(vaultAddress);
        validVaults[vaultAddress] = true;
        isERC20Vault[vaultAddress] = true;
        totalVaultsCreated++;

        // Automatically register vault with automation system if available
        if (address(automationContract) != address(0)) {
            try automationContract.addVault(vaultAddress) {
                // Vault successfully registered for automatic withdrawal
            } catch {
                // Automation registration failed, but vault creation succeeded
                // Users can still manually register or withdraw
            }
        }

        emit VaultCreated(msg.sender, vaultAddress, totalVaultsCreated, true);
        emit ERC20VaultCreated(msg.sender, vaultAddress, _tokenAddress, totalVaultsCreated);
        return vaultAddress;
    }

    function getUserVaults(address _user) external view returns (address[] memory) {
        require(_user != address(0), "Invalid user address");
        return userVaults[_user];
    }

    function removeVault(address _vaultAddress) external {
        require(_vaultAddress != address(0), "Invalid vault address");
        require(validVaults[_vaultAddress], "Vault not created by this factory");

        bool isERC20 = isERC20Vault[_vaultAddress];

        if (isERC20) {
            ERC20TimeCapsuleVault vault = ERC20TimeCapsuleVault(_vaultAddress);

            // Verify the caller is the vault creator
            require(vault.creator() == msg.sender, "Not vault creator");

            // Check if vault can be removed
            require(!vault.isUnlocked(), "Vault is still locked");
            require(vault.getBalance() == 0, "Vault is not empty");
        } else {
            TimeCapsuleVault vault = TimeCapsuleVault(_vaultAddress);

            // Verify the caller is the vault creator
            require(vault.creator() == msg.sender, "Not vault creator");

            // Check if vault can be removed
            (bool isLocked, , , , , , , , ) = vault.getLockStatus();
            require(!isLocked, "Vault is still locked");
            require(address(vault).balance == 0, "Vault is not empty");
        }

        // Remove from user's vault list
        address[] storage vaults = userVaults[msg.sender];
        bool found = false;

        for (uint i = 0; i < vaults.length; i++) {
            if (vaults[i] == _vaultAddress) {
                // Move last element to current position and pop
                vaults[i] = vaults[vaults.length - 1];
                vaults.pop();
                found = true;
                break;
            }
        }

        require(found, "Vault not found in user's list");

        // Mark vault as invalid
        validVaults[_vaultAddress] = false;

        emit VaultRemoved(msg.sender, _vaultAddress);
    }

    // Get the number of vaults for a user
    function getUserVaultCount(address _user) external view returns (uint256) {
        require(_user != address(0), "Invalid user address");
        return userVaults[_user].length;
    }

    // Check if a vault was created by this factory
    function isValidVault(address _vaultAddress) external view returns (bool) {
        return validVaults[_vaultAddress];
    }

    // Check if a vault is an ERC-20 vault
    function isVaultERC20(address _vaultAddress) external view returns (bool) {
        return isERC20Vault[_vaultAddress];
    }

    // Get paginated vault list to handle users with many vaults
    function getUserVaultsPaginated(
        address _user, 
        uint256 _offset, 
        uint256 _limit
    ) external view returns (address[] memory) {
        require(_user != address(0), "Invalid user address");
        require(_limit > 0 && _limit <= 50, "Invalid limit"); // Max 50 per page

        address[] storage allVaults = userVaults[_user];
        uint256 totalVaults = allVaults.length;

        if (_offset >= totalVaults) {
            return new address[](0);
        }

        uint256 end = _offset + _limit;
        if (end > totalVaults) {
            end = totalVaults;
        }

        uint256 length = end - _offset;
        address[] memory result = new address[](length);

        for (uint256 i = 0; i < length; i++) {
            result[i] = allVaults[_offset + i];
        }

        return result;
    }

    // Get total number of vaults created by this factory
    function getTotalVaultsCreated() external view returns (uint256) {
        return totalVaultsCreated;
    }
}

